INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PFS', 'STOCK', 'Provident Financial Services, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Provident Financial Services, Inc. is the holding company for Provident Bank (the Bank). The Bank is a New Jersey-chartered capital stock savings bank operating full-service branch offices throughout New Jersey, Bucks, Lehigh and Northampton counties in Pennsylvania, as well as Orange, Queens and Nassau Counties in New York. The Bank attracts deposits from the general public and businesses primarily in the areas surrounding its banking offices and uses those funds, together with funds generated from operations and borrowings, to originate commercial real estate loans, commercial business loans, residential mortgage loans, and consumer loans. The Bank invests in mortgage-backed securities and other permissible investments. The Bank also provides fiduciary and wealth management services through its wholly owned subsidiary, Beacon Trust Company, and insurance services through its wholly owned subsidiary, Provident Protection Plus, Inc. The Bank has approximately 140 branches.', 'Jersey City, NJ, United States', 1753);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMP', 'STOCK', 'Compass Minerals International, Inc.', 'NYQ', 'Basic Materials', 'Other Industrial Metals & Mining', 'Compass Minerals International, Inc. is a global provider of essential minerals, including salt, sulfate of potash (SOP) and magnesium chloride. The Company is also working to develop a long-term fire-retardant business. Its segments include Salt and Plant Nutrition. Salt segment provides highway deicing salt to customers in North America and the United Kingdom, as well as consumer deicing and water conditioning products, ingredients used in consumer and commercial food preparation, and other salt-based products for consumer, industrial, chemical and agricultural applications in North America. In the United Kingdom, it operates a records management business utilizing excavated areas of its Winsford salt mine with one other location in London, England. Plant Nutrition segment produces and markets SOP products in various grades worldwide to distributors and retailers of crop inputs, as well as growers and for industrial uses. It markets its SOP under the trade name Protassium+.', 'Overland Park, KS, United States', 2000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATKR', 'STOCK', 'Atkore Inc.', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Atkore Inc. is a manufacturer of electrical products for the non-residential construction and renovation markets, as well as residential markets, and safety and infrastructure products for the construction and industrial markets. The Companys segments include Electrical and Safety & Infrastructure. The Electrical segment manufactures products used in the construction of electrical power systems including conduit, cable and installation accessories. This segment serves contractors in partnership with the electrical wholesale channel. The Safety & Infrastructure segment designs and manufactures solutions including metal framing, mechanical pipe, perimeter security and cable management for the protection and reliability of critical infrastructure. These solutions are marketed to contractors, OEMs, and end-users. It manufactures products in 42 facilities and operate a total footprint of over 8.5 million square feet of manufacturing and distribution space in eight countries.', 'Harvey, IL, United States', 5264);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETON', 'STOCK', 'Eton Pharmaceuticals, Inc.', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Eton Pharmaceuticals, Inc. is a pharmaceutical company focused on developing and commercializing treatments for rare diseases. The Company has six commercial rare disease products: INCRELEX, ALKINDI SPRINKLE, PKU GOLIKE, Carglumic Acid, Betaine Anhydrous, and Nitisinone. INCRELEX is a biologic product used to treat pediatric patients 2 years of age and older who suffer from severe primary insulin-like growth factor 1 deficiency (SPIGFD). ALKINDI SPRINKLE is for the treatment of pediatric adrenocortical insufficiency. Carglumic Acid is for the treatment of hyperammonemia due to N-acetylglutamate synthase (NAGS) deficiency. Betaine Anhydrous is for the treatment of homocystinuria. Nitisinone is for the treatment of hereditary tyrosinemia type 1 (HT-1). PKU GOLIKE is a medical formula for patients with phenylketonuria (PKU). Galzin, its product, is FDA-approved for the treatment of the ultra-rare metabolic condition of Wilson Disease.', 'Deer Park, IL, United States', 31);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMEZ', 'STOCK', 'BlackRock Health Sciences Term Trust', 'NYQ', 'Financial Services', 'Asset Management', NULL, 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARCB', 'STOCK', 'ArcBest Corporation', 'NMS', 'Industrials', 'Trucking', 'ArcBest Corporation is a logistics company. It leverages technology and a full suite of solutions to meet its customers supply chain needs. Its segments include Asset-Based, which consists of ABF Freight System, Inc. and certain other subsidiaries, and Asset-Light, which includes MoLo Solutions, LLC (MoLo), Panther, and certain other subsidiaries. The Asset-Based segment provides less-than-truckload (LTL) services through ABF Freights motor carrier operations. Its Asset-Based segment offers transportation of general commodities through standard, time-critical, and LTL services. The Asset-Light segment includes the ground expedite services of Panther; its truckload operations, including the truckload brokerage services of MoLo; household goods moving services under the U-Pack brand and its managed transportation solutions. Its truckload and dedicated services provide third-party transportation brokerage services by sourcing various capacity solutions including dry van over-the-road.', 'Fort Smith, AR, United States', 14000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIP', 'STOCK', 'Brookfield Infrastructure Partners L.P.', 'NYQ', 'Utilities', 'Utilities - Diversified', 'Brookfield Infrastructure Partners L.P. engages in the utilities, transport, midstream, and data businesses. The Utilities segment operates approximately 2,900 kilometers (km) of electricity transmission lines; 3,900 km of natural gas pipelines; 8.4 million electricity and natural gas connections; 0.7 million long-term contracted sub-metering services; and 2.8 million meters under management. This segment also offers cooling, water heaters, solar, and energy storage solutions; gas distribution; heating, ventilation, air conditioner, and water products, including heating and purification, as well as other home services. The Transport segment consists of infrastructure assets that offers transportation, storage, and handling services for merchandise goods, commodities, and passengers through a network of approximately 21,000 km of track; 5,500 km of track; 9,800 km of rail; 3,300 km of motorways. The Midstream segment provides natural gas transmission, gathering and processing, and stora', 'Hamilton, , Bermuda', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVEX', 'STOCK', 'Eve Holding, Inc.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'Eve Holding, Inc. is an aerospace company with operations in Melbourne, Florida and Brazil. The Companys segments include electric vertical takeoff and landing vehicles (eVTOLs), Service and Operations Solutions, and Urban Air Traffic Management (UATM). The eVTOL segment is designing and certifying eVTOL purpose-built for UAM missions and plans to market its eVTOLs globally to operators of UAM services, including fixed wing and helicopter operators, as well as lessors that purchase and manage aircraft on behalf of operators. The Service and Operations Solutions segment offers a full suite of eVTOL service and support capabilities, including material services, maintenance, technical support, training, ground handling and data services. The UATM segment is developing next generation UATM software named Vector to help enable eVTOLs to operate safely and efficiently in dense urban airspace along with conventional fixed wing and rotary aircraft and unmanned drones.', 'Melbourne, FL, United States', 174);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPH', 'STOCK', 'Amphastar Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Amphastar Pharmaceuticals, Inc. is a biopharmaceutical company that focuses primarily on developing, manufacturing, marketing, and selling generic and proprietary injectable, inhalation, and intranasal products. Additionally, it sells insulin API products. Most of its finished products are used in hospital or urgent care clinical settings and are primarily contracted and distributed through group purchasing organizations and drug wholesalers. The Company manufactures and sells over 25 products, such as BAQSIMI (glucagon) nasal powder 3mg, Primatene MIST, Glucagon for Injection Emergency Kit, Enoxaparin, Naloxone and Other Marketed Products, including Cortrosyn (cosyntropin for injection), Amphadase, Epinephrine injection, Lidocaine jelly, Lidocaine topical solution, Phytonadione injection, and others. The Company manufactures and sells two API products, Recombinant Human Insulin (RHI API) and porcine insulin API, for the injectable insulin market.', 'Rancho Cucamonga, CA, United States', 2028);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBVT', 'STOCK', 'DBV Technologies S.A.', 'NCM', 'Healthcare', 'Biotechnology', 'DBV Technologies SA is a France-based clinical-stage biopharmaceutical company focused on changing the field of immunotherapy by developing a technology platform called Vaskin. The Company''s therapeutic approach is based on epicutaneous immunotherapy, or EPIT, its proprietary method of delivering biologically active compounds to the immune system through intact skin using Viaskin. It dedicates its technology to treat patients, including infants and children, suffering from severe food allergies, for whom safety is paramount, since the introduction of the offending allergen into their bloodstream can cause severe or life-threatening allergic reactions, such as anaphylactic shock. The Company''s product portfolio for allergy treatments consists of Viaskin Peanut, Viaskin Milk and Viaskin Egg. The Company operates one subsidiary DBV Technologies Inc. in the United States.', 'Châtillon, , France', 109);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATR', 'STOCK', 'AptarGroup, Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'AptarGroup, Inc. is engaged in designing and manufacturing of drug and consumer product dosing, dispensing and protection technologies. The Company serves various end markets, including pharmaceutical, beauty, food, beverage, personal care and home care. It operates in three segments. The Aptar Pharma segment sells proprietary dispensing systems, drug delivery systems, sealing solutions and services for the prescription drug, consumer health care, injectables, active material science solutions and digital health market. It also specializes in nasal drug delivery for delivering drugs. The Aptar Beauty segment sells dispensing systems and sealing solutions for the beauty, personal care and home care markets. The Aptar Closures segment sells dispensing systems, sealing solutions and food service trays to the food, beverage, personal care, home care, beauty and healthcare markets. This segment also includes the food protection business and the elastomeric flow-control technology business.', 'Crystal Lake, IL, United States', 13000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRUS', 'STOCK', 'Cirrus Logic, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Cirrus Logic, Inc. is a provider of low-power, high-precision mixed-signal processing solutions that enhance user experience in mobile and consumer applications. Its product line categories are Audio and High-Performance Mixed-Signal (HPMS). It is a supplier of low-power, low-latency, high-precision audio components that are used in a variety of applications, including smartphones, laptops, tablets, virtual reality/augmented reality headsets, wearables, home theater systems, automotive entertainment systems and professional audio systems. Additionally, its SoundClear technology consists of a broad portfolio of tools, software and algorithms that help to differentiate its customers products by improving the user experience with features such as louder, high-fidelity sound, high-quality audio playback, voice capture, and hearing augmentation. Its portfolio of HPMS products includes camera controllers for automatic focus and optical image stabilization and haptic and sensing solutions.', 'Austin, TX, United States', 1643);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CASH', 'STOCK', 'Pathward Financial, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Pathward Financial, Inc. is a financial holding company. The Company operates through its subsidiary Pathward, National Association (the Bank). The Bank operates through three segments: Consumer, Commercial, and Corporate Services/Other. The Consumer segment includes the banking-as-a-service (BaaS) business line, which collaborates with partners to navigate payment and lending needs. The Bank''s capabilities range from prepaid cards and deposit accounts to payment processing and consumer lending. The Bank offers a variety of installment and revolving consumer lending products through its credit solutions. The Commercial segment offers a variety of products through its working capital, equipment finance, structured finance, and insurance premium finance lending solutions. The Corporate Services/Other segment includes certain shared services as well as treasury related functions, such as the investment portfolio, warehouse finance, wholesale deposit, and borrowings.', 'Sioux Falls, SD, United States', 1178);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATHM', 'STOCK', 'Autohome Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Autohome Inc é uma holding principalmente envolvida na operação de plataforma de serviços on-line para consumidores de automóveis. Através de seus sites, autohome.com.cn, che168.com e tpai.cn, a Empresa está principalmente envolvida no fornecimento de conteúdo e ferramentas para os consumidores de automóveis, bem como um conjunto completo de serviços para montadoras e revendedores em toda a cadeia de valor de automóveis. A empresa fornece principalmente serviços de mídia, serviços de geração de leads e mercado on-line e outros. Os serviços de mídia fornecem principalmente montadoras e escritórios regionais de marcas de automóveis com uma ampla gama de soluções e ferramentas de publicidade. Os serviços de geração de leads incluem principalmente serviços de assinatura, serviços de publicidade, listagem de automóveis usados e outros serviços baseados em plataforma. O mercado on-line e outras empresas incluem produtos de dados, serviços de transação de carros novos e usados e negócios de f', 'Beijing, , China', 4360);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EIC', 'STOCK', 'Eagle Point Income Company Inc.', 'NYQ', 'Financial Services', 'Asset Management', NULL, 'Greenwich, CT, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMPR', 'STOCK', 'Cimpress plc', 'NMS', 'Industrials', 'Specialty Business Services', 'Cimpress plc is focused on mass customization of printing and related products, via which it delivers volumes of individually small-sized customized orders. Its segments include Vista, PrintBrothers, The Print Group, National Pen and All Other Businesses. The Vista segment includes Vista, the parent brand of multiple offerings, including VistaPrint, VistaCreate, 99designs by Vista, Vista Corporate Solutions, and Depositphotos. The PrintBrothers segment includes its druck.at, Printdeal, and WIRmachenDRUCK businesses. The Print Group segment includes its Easyflyer, Exaprint, Pixartprinting, and Tradeprint businesses. The National Pen segment includes the global operations of its National Pen business, which manufactures and markets custom writing instruments and promotional products, apparel and gifts. The All Other Businesses segment includes two businesses grouped together based on materiality. Its products are marketing materials, business cards, signage, packaging and others.', 'Dundalk, , Ireland', 15000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLK', 'STOCK', 'BlackRock, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Blackrock, Inc. É uma empresa de gestão de investimentos. A empresa oferece uma gama de serviços de gestão de investimentos e tecnologia para clientes institucionais e de varejo. Sua plataforma diversificada de estratégias de investimento ativas e privadas, de índices e de gestão de caixa em todas as classes de ativos permite que a empresa adapte resultados de investimento e soluções de alocação de ativos para os clientes. Suas ofertas de produtos incluem carteiras de ativos únicos e múltiplos investindo em ações, renda fixa, alternativas e instrumentos do mercado monetário. Seus produtos são oferecidos diretamente e através de intermediários em uma variedade de veículos, incluindo fundos mútuos de ponta aberta e fechada, fundos negociados em bolsa iShares, contas separadas, fundos de investimento coletivo e outros veículos de investimento agrupados. Ele também oferece serviços de tecnologia, incluindo a plataforma de tecnologia de gestão de risco e investimento, Aladdin, Aladdin Wealt', 'New York, NY, United States', 22700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCYC', 'STOCK', 'Bicycle Therapeutics plc', 'NMS', 'Healthcare', 'Biotechnology', 'Bicycle Therapeutics plc is a United Kingdom-based clinical-stage biopharmaceutical company developing a class of medicines, referred to as Bicycle molecules, for diseases that are underserved by existing therapeutics. Bicycle molecules are fully synthetic short peptides constrained with small molecule scaffolds to form two loops that stabilize their structural geometry. The Company is evaluating zelenectide pevedotin, a Bicycle Toxin Conjugate (BTC) targeting Nectin-4, a well-validated tumor antigen; BT5528, a BTC targeting EphA2, a historically undruggable target, and BT7480, a Bicycle Tumor-Targeted Immune Cell Agonist (Bicycle TICA) targeting Nectin-4 and agonizing CD137, in Company-sponsored clinical trials. Additionally, the Company is developing Bicycle Radio Conjugates (BRC) for radiopharmaceutical use and, through various partnerships, is exploring the use of Bicycle technology to develop therapies for diseases beyond oncology.', 'Cambridge, , United Kingdom', 305);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHF', 'STOCK', 'BNY Mellon High Yield Strategies Fund', 'NYQ', 'Financial Services', 'Asset Management', 'BNY Mellon High Yield Strategies Fund is a closed ended fixed income mutual fund launched and managed by BNY Mellon Investment Adviser, Inc. The fund invests in the fixed income markets of the United States. It primarily invests in fixed income securities of below investment grade quality, including securities of companies at early stages of development and companies with a highly leveraged financial structure. The fund benchmarks the performance of its portfolio against the BofA Merrill Lynch U.S High Yield Master II Constrained Index. It was formerly known as Dreyfus High Yield Strategies Fund. BNY Mellon High Yield Strategies Fund was formed in April 29, 1998 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHH', 'STOCK', 'Choice Hotels International, Inc.', 'NYQ', 'Consumer Cyclical', 'Lodging', 'Choice Hotels International, Inc. is a lodging franchisor with over 7,500 hotels, representing over 650,000 rooms, in 46 countries and territories. The Companys segments include Hotel Franchising & Management and Corporate & Other. The Hotel Franchising & Management reportable segment includes the Company''s hotel franchising operations, which consist of its approximately 22 brands and brand extensions and the hotel management operations of 13 hotels (inclusive of four-owned hotels). Its brand names include Comfort Inn, Comfort Suites, Quality, Clarion, Clarion Pointe, Ascend Hotel Collection, Sleep Inn, Econo Lodge, Rodeway Inn, MainStay Suites, Suburban Studios, WoodSpring Suites, Everhome Suites, and Cambria Hotels (collectively, the legacy Choice brands). It also includes Radisson Blu, Radisson RED, Radisson, Park Plaza, Country Inn & Suites by Radisson, Radisson Inn & Suites, Park Inn by Radisson, Radisson Individuals, and Radisson Collection.', 'North Bethesda, MD, United States', 1695);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRVS', 'STOCK', 'Corvus Pharmaceuticals, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Corvus Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on the development of ITK inhibition as a new approach to immunotherapy for a range of cancer and immune diseases. Its lead product candidate is soquelitinib, is designed to bind specifically to a protein, interleukin 2 inducible T cell kinase (ITK), involved in T cell activation, T cell receptor signaling and T cell differentiation and function. ITK, an enzyme that functions in T cell signaling and differentiation, is expressed predominantly in T cells. Its second product candidate, ciforadenant, is an oral, small molecule antagonist of the A2A receptor for adenosine designed to disable a tumors ability to subvert attack by the immune system by blocking the binding of immunosuppressive adenosine in the tumor microenvironment to the A2A receptor. The Companys third product candidate is mupadolimab, a humanized monoclonal antibody that is designed to react with a specific site on CD73.', 'South San Francisco, CA, United States', 31);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADVB', 'STOCK', 'Advanced Biomed Inc.', 'NCM', 'Healthcare', 'Diagnostics & Research', 'Advanced Biomed Inc. is a holding company that operates, through its subsidiaries, Advanced Biomed Inc. (Taiwan) and Advanced Biomed HK Limited. The Company is engaged in the provision of assay products and services for cancer patients. These services include early screening and detection, diagnosis and staging, treatment selection, and patient outcome interventions for cancer. It has developed a microfluidic technology platform to integrate research and development, design, and manufacture of biochips and microfluidic chips. The platform combines its patented chip technology and will enable localized operations of a variety of microfluidic chips, biosensors made by semiconductor fabrication technology, and integrated application patented technology. The Company offers devices, such as A+Pre, AC-1000, A+CellScan, and A+SCDrop, and three corresponding microfluidic biochips, A+Pre-Chip and AC-1000 CTC Enrichment Chip and A+CellScan Chip.', 'New York, NY, United States', 40);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALEX', 'STOCK', 'Alexander & Baldwin, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Alexander & Baldwin, Inc. is a real estate investment trust (REIT). The Company is focused on owning, operating, and developing commercial real estate. The Company operates through two segments: Commercial Real Estate and Land Operations. The Commercial Real Estate segment functions as a vertically integrated real estate investment company with competencies in investments and acquisitions, including identifying opportunities and acquiring properties; construction and development, including designing and ground-up development of new properties, and in-house leasing and property management. The Land Operations segment includes the Company''s landholdings, joint venture investments, and liabilities that are subject to the Company''s simplification and monetization effort. It owns, operates, and manages approximately 4.0 million square feet of commercial space in Hawai''i, including 21 retail centers, 14 industrial assets and four office properties, as well as 146 acres of ground leases.', 'Honolulu, HI, United States', 96);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHW', 'STOCK', 'Calamos Global Dynamic Income Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Global Dynamic Income Fund is a closed ended balanced mutual fund launched by Calamos Investments LLC. The fund is managed by Calamos Advisors LLC. It invests in public equity and fixed income markets across the globe. The fund seeks to invest in securities of companies operating across diversified sectors. It primarily invests in growth stocks of companies across all market capitalizations, as well as in higher yield corporate bonds, government bonds, convertibles, and alternative investments such as arbitrage and call writes. The fund employs both fundamental and quantitative analysis, focusing on such factors as source, sustainability, and risk of investment opportunities to create its portfolio. It benchmarks the performance of its portfolio against the MSCI World Index and Merrill Lynch Global Broad Markets Index. The fund was formerly known as Calamos Global Diversified Income & Opportunities Fund. Calamos Global Dynamic Income Fund was formed on April 10, 2007 and is dom', 'Naperville, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMRE', 'STOCK', 'Costamare Inc.', 'NYQ', 'Industrials', 'Marine Shipping', 'Costamare Inc is a Monaco-based company that provides containerships and dry bulk vessels for charter. The Company is an international shipping industry that offers a fleet of 73 containerships, with a total capacity of approximately 537,000 TEU (including two vessels that have agreed to sell) and 45 dry bulk vessels with a total capacity of approximately 2,436,000 DWT. Its offers containerships of various sizes (including feeder, panamax and post-panamax containerships) serve short, medium, and long-haul routes on a variety of geographical trades. Its dry bulk vessels transport a broad range of bulks such as iron ore, coal, and grains as well as minor bulks such as bauxite, phosphate fertilizers and steel products. The Company serve its customer''s needs worldwide and ensure the safety, reliability, and environmental responsibility of services.', 'Monaco, , Monaco', 2430);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLX', 'STOCK', 'Deluxe Corporation', 'NYQ', 'Industrials', 'Conglomerates', 'Deluxe Corporation is a payments and data company. Its Merchant Services segment provides electronic credit and debit card authorization and payment systems and processing services, primarily to small and medium-sized retail and service businesses. The B2B Payments segment provides treasury management solutions, including remittance and lockbox processing, remote deposit capture, cash application, and payment acceptance solutions, as well as integrated accounts payable disbursements, such as e-checks, Medical Payment Exchange, and Deluxe Payment Exchange+, as well as fraud and security services. Data Solutions segment provides data, analytics, and marketing services for both business-to-business and business-to-consumer marketing, as well as financial institution profitability reporting and business incorporation services. Print segment provides printed personal and business checks, business essentials, as well as branded promotional, print, apparel, and digital storefront solutions.', 'Minneapolis, MN, United States', 4981);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LXEO', 'STOCK', 'Lexeo Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Lexeo Therapeutics, Inc. is a clinical-stage genetic medicine company dedicated to transforming healthcare by applying pioneering science to fundamentally change how genetically defined cardiovascular diseases and APOE4-associated Alzheimers disease are treated. Using a stepwise development approach, the Company is leveraging early proof-of-concept functional and biomarker data to advance a pipeline of cardiovascular and APOE4-associated Alzheimers disease programs. Its pipeline consists of candidates targeting patient populations. Its most advanced cardiovascular product candidate, LX2006 for the treatment of patients with Friedreichs ataxia (FA), cardiomyopathy, is being evaluated in SUNRISE-FA, an ongoing Phase I/II clinical trial. Its second most advanced cardiovascular product candidate, LX2020 for the treatment of arrhythmogenic cardiomyopathy, caused by mutations in the PKP2 gene (PKP2-ACM), received IND clearance from the United States Food and Drug Administration (FDA).', 'New York, NY, United States', 75);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIHL', 'STOCK', 'Fidelis Insurance Holdings Limited', 'NYQ', 'Financial Services', 'Insurance - Diversified', 'Fidelis Insurance Holdings Limited is a Bermuda-based insurance and reinsurance company. The Company is a holding company. Through its subsidiaries, it provides specialty, bespoke, and property insurance and reinsurance. The Company classifies its business into three segments: Specialty, Bespoke, and Reinsurance. The Specialty segment comprises a portfolio of aviation and aerospace, energy, marine, property, property direct and facultative (D&F) business, and other specialty risks. The Bespoke segment provides customized risk solutions for clients, which include credit and political risk, and other bespoke risk transfer opportunities. The Reinsurance segment is primarily a residential property catastrophe book, which includes property reinsurance, retrocession, and whole account reinsurance. The subsidiaries of the Company are Fidelis Insurance Bermuda Limited (FIBL), Fidelis Underwriting Limited (FUL), Fidelis Insurance Ireland DAC (FIID), and FIHL (UK) Services Limited (FSL).', 'Pembroke, , Bermuda', 98);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIR', 'STOCK', 'AAR Corp.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'AAR Corp. is a global aerospace and defense aftermarket solutions company with operations in over 20 countries. The Companys Parts Supply segment consists of its sales of used serviceable engine and airframe parts and components and distribution of new parts. The Repair & Engineering segment consists of its maintenance, repair, and overhaul (MRO) services across airframes and components. The Integrated Solutions segment consists of its fleet management and operations of customer-owned aircraft, customized performance-based supply chain logistics programs in support of the United States (U.S.) Department of Defense, U.S. Department of State, and foreign governments, flight hour component inventory and repair programs for commercial airlines, and integrated software solutions, including Trax. The Expeditionary Services segment consists of products and services supporting the movement of equipment and personnel by the U.S. and foreign governments and non-governmental organizations.', 'Wood Dale, IL, United States', 5600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTA', 'STOCK', 'Centessa Pharmaceuticals plc', 'NMS', 'Healthcare', 'Biotechnology', 'Centessa Pharmaceuticals plc is a clinical-stage pharmaceutical company. The Company is developing a new class of potential therapies within its orexin receptor 2 (OX2R) agonist program for the treatment of excessive daytime sleepiness (EDS), impaired attention, cognitive deficits, fatigue and other symptoms across neurological, neurodegenerative and neuropsychiatric disorders. It also has an early-stage immuno-oncology program focused on its LockBody technology platform. Its OX2R agonist pipeline includes ORX750, its advanced OX2R agonist development candidate, and ORX142, ORX489 and OX2R agonists in preclinical development. Its ORX750, an investigational, orally administered, highly potent and selective OX2R agonist, is in a Phase IIa study of participants with narcolepsy type 1 (NT1), NT2 and idiopathic hypersomnia (IH). ORX142 is the second OX2R agonist development candidate being advanced for the treatment of neurological and neurodegenerative disorders and other symptoms.', 'Altrincham, , United Kingdom', 98);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDL', 'STOCK', 'Dingdong (Cayman) Limited', 'NYQ', 'Consumer Defensive', 'Grocery Stores', 'Dingdong (Cayman) Ltd is a China-based e-commerce company. The Company offers groceries and other daily necessities directly delivered to users and households. The Companys groceries offerings include fresh produce, meat and seafood and other daily necessities. The Company procure its products primarily from direct upstream sources such as farms and cooperatives. The Companys frontline fulfillment grid consists of more than 950 frontline fulfillment stations across 29 cities in China. Its frontline fulfillment grid is also supported by approximately 40 regional processing centers to sort, package, label and store raw products prior to fulfillment.', 'Shanghai, , China', 3120);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARW', 'STOCK', 'Arrow Electronics, Inc.', 'NYQ', 'Technology', 'Electronics & Computer Distribution', 'A Arrow Electronics, Inc. Fontes e tecnologia de engenheiros para milhares de fabricantes, provedores de serviços e usuários de soluções de computação empresarial. Seus segmentos incluem componentes globais e ECS global. Ela distribui componentes eletrônicos para fabricantes de equipamentos originais e fornecedores de fabricantes de equipamentos por meio de seu segmento global de componentes e fornece soluções de computação empresarial para revendedores de valor agregado e provedores de serviços gerenciados por meio de seu segmento global de portáteis ECS. O portfólio global do ECS inclui soluções de datacenter, nuvem, segurança e análise. A Global ECS oferece suporte aos clientes, permitindo que seus negócios de software e soluções em nuvem sejam viabilizados por meio do ArrowSphere, uma plataforma de mercado e gerenciamento de software e nuvem. Mantém mais de 140 instalações de vendas e 36 centros de distribuição e valor agregado, atendendo mais de 85 países. Possui operações em cada', 'Centennial, CO, United States', 21520);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACIU', 'STOCK', 'AC Immune SA', 'NGM', 'Healthcare', 'Biotechnology', 'AC Immune SA is a Switzerland-based clinical-stage biopharmaceutical company. The Company focuses on precision medicine for neurodegenerative diseases. It designs, discovers and develops therapeutic, as well as diagnostic products for prevention, diagnosis and treatment of diseases caused by misfolding proteins. Its SupraAntigen and Morphomer technology platforms to create antibodies, small molecules and vaccines designed to address a broad range of neurodegenerative indications, such as Alzheimer''s disease (AD). The Company''s pipeline includes nine therapeutic product candidates with five in clinical trials, and three diagnostic candidates. Its lead product candidate is Crenezumab, a humanized and monoclonal anti-Abeta antibody for Alzheimers disease. It has collaborations with pharmaceutical companies, including Roche/Genentech, Eli Lilly, Biogen, Janssen Pharmaceuticals, Nestle Institute of Health Sciences, Life Molecular Imaging (formerly Piramal Imaging) and Essex Bio-Technolog', 'Lausanne, , Switzerland', 133);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRRR', 'STOCK', 'CoinShares Bitcoin ETF', 'NGM', NULL, NULL, 'In seeking to achieve its investment objective, the Trust will hold bitcoin and will value its Shares daily based on the value of bitcoin as reflected by the index, which is an independently calculated value based on an aggregation of executed trade flow of major bitcoin spot exchanges.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHAB', 'STOCK', 'Enhabit, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Enhabit, Inc. is a provider of home health and hospice services in the United States. Its segments include Home Health and Hospice. The Home Health segment provides a comprehensive range of Medicare-certified skilled home health services, including skilled nursing, physical, occupational and speech therapy, medical social work, and home health aide services. It works closely with patients, families, caregivers, and physicians to deliver data-driven, evidence-based care plans focused on patient needs and goals. Its home health services are provided by nurses, physical, occupational and speech therapists, medical social workers, and home health aides. The Hospice segment provides hospice services to terminally ill patients and their families. Hospice care focuses on the quality of life for patients experiencing an advanced, life- limiting illness by treating the symptoms of the disease, rather than the disease itself. It operates about 115 hospice agencies and 255 home health agencies.', 'Dallas, TX, United States', 10600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGEN', 'STOCK', 'Compugen Ltd.', 'NCM', 'Healthcare', 'Biotechnology', 'Compugen Ltd. is a therapeutic discovery company. The Company focuses on infrastructure to discover drug targets and develop therapeutics. The Company is engaged in the research, development and commercialization of therapeutic and product candidates. The Company''s pipeline primarily consists of early and preclinical stage immuno-oncology programs based on drug targets discovered by the Company, primarily immune checkpoint and myeloid protein target candidates. These programs are focused on the development of cancer immunotherapy drugs with potential to harness the immune system to provide treatment solutions in areas of unmet medical needs in various cancer types and patient populations, both as monotherapy and in combination with other drugs. Its pipeline also includes a preclinical stage fusion protein autoimmune product candidate. Its fields of focus are oncology and immunology, with emphasis on its discovery capabilities on immuno-oncology.', 'Holon, , Israel', 74);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZ', 'STOCK', 'A2Z Cust2Mate Solutions Corp.', 'NCM', 'Technology', 'Software - Application', 'A2Z Cust2Mate Solutions Corp. is engaged in smart retail technology. The Company creates solutions for complex challenges. Its flagship product is the in-use mobile self-checkout shopping cart. With its user-friendly algorithm, touch screen, and other technologies, it streamlines the retail shopping experience by scanning purchased products and enabling in-cart payment so that customers can pick and go, and bypass long cashier checkout lines. Its in-cart solution also enables shoppers to use the cart as the point of sale by use of mobile payment applications, e-wallets and other financial services. Its Services segment includes maintenance services to the military, utilizing the application of advanced engineering capabilities as well as the development of related products for the civilian and retail markets. The Smart Carts segment includes retail automation solutions. The Precision Metal Parts segment is engaged in manufacturing and selling precision metal parts.', 'Vancouver, BC, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTH', 'STOCK', 'Astrana Health, Inc.', 'NCM', 'Healthcare', 'Medical Care Facilities', 'Astrana Health, Inc. is a physician-centric, artificial intelligence (AI)-powered healthcare company focused on delivering patient-centered care. The Company provides care coordination services to each major constituent of the healthcare delivery system, including patients, families, primary care physicians, specialists, acute care hospitals, alternative sites of inpatient care, physician groups, and health plans. The Company''s segments include Care Partners, Care Delivery, and Care Enablement. Its Care Partners segment is focused on building and managing provider networks by partnering with, empowering, and investing in provider partners aligned on a shared vision for coordinated care delivery. Its Care Delivery organization includes primary care, multi-specialty care, and ancillary care services. Its Care Enablement segment represents a comprehensive platform that integrates clinical, operational, financial, and administrative information. It supports more than 20,000 providers.', 'Alhambra, CA, United States', 1900);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COHU', 'STOCK', 'Cohu, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Cohu, Inc. is engaged in supplying test, interface, automation, inspection and metrology, and software products and related services to the semiconductor industry. The Company sells its products, such as semiconductor automated test equipment (ATE), semiconductor handlers, interface products, inspection metrology, DI-Core data analytics, spares and kits and services. Its semiconductor ATE is used both for wafer level and device package testing. Its solutions consist primarily of two platforms for the system on a chip (SoC) device market: Diamondx tester and PAx tester. Interface Products are comprised of test contactors, probe heads and probe pins. Inspection Metrology are products that provide advanced vision capabilities. DI-Core data analytics is a comprehensive software suite used to optimize Cohu equipment performance. Spares and Kits are consumable, non-consumable and spare items. It provides various parts and labor warranties on its test and handling systems and instruments.', 'Poway, CA, United States', 2986);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSL', 'STOCK', 'Carlisle Companies Incorporated', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Carlisle Companies Incorporated is a manufacturer and supplier of building envelope products and solutions that enable energy efficiency in buildings. Its segments include Carlisle Construction Materials (CCM) and Carlisle Weatherproofing Technologies (CWT). The CCM segment produces a complete line of energy-efficient single-ply roofing products and warranted roof systems and accessories for the commercial building industry, including ethylene propylene diene monomer (EPDM), thermoplastic polyolefin (TPO) and polyvinyl chloride (PVC) membrane, polyisocyanurate (polyiso) insulation, and engineered metal roofing and wall panel systems for commercial and residential buildings. CWT segment produces building envelope solutions that drive energy efficiency and sustainability in commercial and residential applications. Its products include waterproofing and moisture protection products, protective roofing underlayments, fully integrated liquid and sheet applied air/vapor barriers and others.', 'Scottsdale, AZ, United States', 5500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGTL', 'STOCK', 'Creative Global Technology Holdings Limited', 'NCM', 'Consumer Cyclical', 'Specialty Retail', 'Creative Global Technology Holdings Ltd is a holding company mainly engaged in sale of recycled and refurbished electronics. The Company is mainly engaged in the wholesale of recycled and refurbished electronics. The Company is also engaged in online retail business. In addition, the Company is engaged in the provision of rental services. The Company accepts a wide range of electronic devices for recycling, computers and laptops, mobile phones and tablets and electronic accessories.', 'Kwun Tong, , Hong Kong', 17);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFG', 'STOCK', 'American Financial Group, Inc.', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'American Financial Group, Inc. is an insurance holding company. Through the operations of Great American Insurance Group, the Company is engaged primarily in property and casualty insurance, focusing on specialized commercial products for businesses. The Companys segments include property and casualty insurance and Other. The property and casualty insurance business includes specialty sub-segments: property and transportation, which includes physical damage and liability coverage for buses and trucks and other specialty transportation niches, inland and ocean marine, agricultural-related products and other commercial property coverage; specialty casualty, which includes primarily excess and surplus, executive and professional liability, general liability, umbrella and excess liability, and specialty financial, which includes risk management insurance programs for lending and leasing institutions, fidelity and surety products and trade credit insurance.', 'Cincinnati, OH, United States', 8700);\n
